import React, { useEffect, useReducer, useState } from 'react'
const App = () => {

  const initialState = false;
  const reducer=(state,action)=>{
    switch(action.type){
      case 'increment':
        return state

      default:
        return state

    }

  }

  const [check,dispatch] = useReducer(reducer,initialState);
  return (
    <React.Fragment>
      <input type="checkbox" value={check} onChange={()=>dispatch({type:'increment'})}/>
      <label>{check?"checked":"not checked"}</label>
    </React.Fragment>
  )
}

export default App
